import React from 'react';

import s from './Advert.module.css';
import img from './kalina_4.jpg';

const Advert = () => {
    const Button = styled.button`
      background-color: #130F1C;
    `;

    return (
        <div>
            <img src="kalina_4.jpg" alt=""/>
            
            <div className={s.container}>
                <img className={s.labelImage} src={img} alt=""/>
                <span className={s.nameAd}>Продам машину</span>

                <span className={s.price}>50.000$</span>
                <span className={s.description}>Топ за свои деньги</span>
                <span className={s.datePublish}>30.03.2022</span>
            </div>
        </div>
    );
};

export default Advert;
